import Tasks from "./Tasks"

const Task = ( {tasks, onDelete, onToggle }) => {


  return (
    <div>
      {tasks.map((task) => (
        <Tasks key={task.id}
        task = {task}
        onDelete={onDelete}
        onToggle = {onToggle} />
      ))}
    </div>
  )
}

export default Task
